import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import logo from "../assets/logo.jpg";
import ring1 from "../assets/luxury-ring1.jpg";
import ring2 from "../assets/luxury-ring2.jpg";
import ring3 from "../assets/luxury-ring3.jpg";

const BASE_URL = "http://localhost:5000";

const LuxuryRings = () => {
  const navigate = useNavigate();
  const [search, setSearch] = useState("");

  const rings = [
    { name: "Silver Solitaire Diamond Ring", img: ring1, desc: "Elegant silver ring featuring a single sparkling diamond at the center.", price: "₹60,000" },
    { name: "Silver Multi-Stone Ring", img: ring2, desc: "Sophisticated silver ring adorned with multiple silver and white stones.", price: "₹75,000" },
    { name: "Golden Diamond & White Stone Ring", img: ring3, desc: "Luxury golden ring with white diamonds and a striking white nag.", price: "₹1,20,000" },
  ];

  const filtered = rings.filter(i => i.name.toLowerCase().includes(search.toLowerCase()));

  const handleAddToCart = async (item) => {
    try {
      await fetch(`${BASE_URL}/cart`, { method: "POST", headers: { "Content-Type": "application/json" }, body: JSON.stringify(item) });
      alert(`${item.name} added to Cart!`);
    } catch (err) {
      console.error(err);
      alert("Failed to add to Cart");
    }
  };

  const handleBuyNow = async (item) => {
    try {
      await fetch(`${BASE_URL}/orders`, { method: "POST", headers: { "Content-Type": "application/json" }, body: JSON.stringify(item) });
      alert(`${item.name} added to Orders!`);
      navigate("/orders");
    } catch (err) {
      console.error(err);
      alert("Failed to place order");
    }
  };

  const handleWishlist = async (item) => {
    try {
      await fetch(`${BASE_URL}/wishlist`, { method: "POST", headers: { "Content-Type": "application/json" }, body: JSON.stringify(item) });
      alert(`${item.name} added to Wishlist!`);
    } catch (err) {
      console.error(err);
      alert("Failed to add to Wishlist");
    }
  };

  return (
    <div>
      <header style={{ display: "flex", justifyContent: "space-between", padding: "15px 30px", background: "#f8f8f8" }}>
        <img src={logo} alt="logo" style={{ height: "50px" }} />
        <nav>
          <a href="/">Home</a> | <a href="/collections">Collections</a> | <a href="/orders">Orders</a> | <a href="/wishlist">Wishlist</a>
        </nav>
      </header>

      <div style={{ textAlign: "center", margin: "30px 0" }}>
        <input value={search} onChange={e => setSearch(e.target.value)} placeholder="Search Rings..." />
      </div>

      <div style={{ display: "flex", gap: "20px", justifyContent: "center", flexWrap: "wrap" }}>
        {filtered.map((item, idx) => (
          <div key={idx} style={{ border: "1px solid #ddd", padding: "15px", width: "250px", textAlign: "center" }}>
            <img src={item.img} alt={item.name} style={{ width: "100%", height: "200px", objectFit: "cover" }} />
            <h3>{item.name}</h3>
            <p>{item.desc}</p>
            <p style={{ fontWeight: "bold", color: "#d6336c" }}>{item.price}</p>
            <div style={{ display: "flex", justifyContent: "space-around", marginTop: "10px" }}>
              <button onClick={() => handleBuyNow(item)}>Buy Now</button>
              <button onClick={() => handleAddToCart(item)}>Add to Cart</button>
              <button onClick={() => handleWishlist(item)}>Wishlist</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default LuxuryRings;
